      <Paper elevation={3} className={classes.body}>
        <Grid item>
          <Typography variant="h4" component="h2">
            My Jobs
          </Typography>
        </Grid>
        <Grid item xs>
          <TextField
            label="Search Jobs"
            style={{ width: '500px' }}
            variant="outlined"
          />
        </Grid>
        <h4>List</h4>
        <h4>Company Name</h4>
        <h4>Job Title</h4>
        <h4>Skill</h4>
        <h4>Job Type</h4>
        <h4>Salary</h4>
        <h4>Position</h4>
      </Paper>
    </>
  );
};

export default MyJobs;
